  false,\n\t\"url\": null,\n\t\"notes\": \"The GLobal Ocean Data Analysis Project
  (GLODAP) is a cooperative effort to coordinate global synthesis projects funded
  through NOAA/DOE and NSF as part of the Joint Global Ocean Flux Study - Synthesis
  and Modeling Project (JGOFS-SMP). Cruises conducted as part of the World Ocean Circulation
  Experiment (WOCE), Joint Global Ocean Flux Study (JGOFS) and NOAA Ocean-Atmosphere
  Exchange Study (OACES) over the decade of the 1990s have created an oceanographic
  database of unparalleled quality and quantity. These data provide an important asset
  to the scientific community investigating carbon cycling in the oceans.\",\n\t\"license_title\":
